import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Form from "react-bootstrap/Form";
import Stack from "react-bootstrap/Stack";
import { BsFillFunnelFill } from "react-icons/bs";

// importing Components
import VehicleFilters from "../components/VehicleFilters.js";
import VehiclesCardrousel from "../sections/VehiclesCardrousel.js";
import VehicleSearchBar from "../components/VehicleSearchBar.js";
import VehicleSortBtn from "../components/VehicleSortBtn.js";
import VehicleCard from "../components/VehicleCard.js";
import { VehicleSearchResult } from "../components/VehicleSearchResult.js";

export const Vehicles = () => {
  return (
    <main className="">
      <VehicleSearchBar />
      <VehicleSearchResult />

      <div className="bg-primary p-2">
        </div>
  
      <Row className="bg-dark">
          <Col className="">
            <VehicleFilters/>
          </Col>
          <Col xs={6} className="justify-content-center">  
            <VehiclesCardrousel />
          </Col>
          <Col></Col>
        </Row>
    
    </main>
  );
};

export default Vehicles;
